import React, { useEffect, useState } from 'react';

/*Componentes */
import ProductHome from '../components/ProductHome';

function Home(){;

  /*//////Request GET//////*/
    let results = "";

    const [data, setData] = useState([]);

    const apiURL = "/api/database"; 
    let fetchAPI = async() =>{
      const res = await fetch(apiURL);
      return res;
    }

    useEffect(() =>{
      fetchAPI()
      .then(res => {
        return res.json()
      })
      .then(json => {
        results = JSON.parse(json);
        console.log(results);
        setData(results);
        return results;
      }).catch( err => {
        console.log("fetch error" + err);
      })
    }, []);
  /*//////////////////////*/

  
    return(
    <div>
      <svg height="500px" width="100%" style={{ position: "absolute"}}>
                <circle cx="5%" cy="50" r="21.719vw" stroke="" stroke-width="0" fill="#45b096" />
                <circle cx="27%" cy="25" r="5%" stroke="" stroke-width="0" fill="#45b096" />
                <circle cx="100%" cy="100%" r="21.719vw" stroke="" stroke-width="0" fill="#45b096" />
                <circle cx="75%" cy="100%" r="10.86vw" stroke="" stroke-width="0" fill="#45b096" />
      </svg>      
      <img className="logoTittle"
            src={require(`../images/Logo Elisen Completo.png`)}
            alt='Logo Jardin Elisen'
            />
            <img 
            className='principal-home-image'
            src={require(`../images/Captura3.jpg`)}
            alt={"Imagen Portada Jardin Elisen"}/>
      <h1>
          ¡Contamos con {data.length} productos para vos!
      </h1>
      <div className='grid'>
                <ProductHome/>
                <ProductHome/>
                <ProductHome/>
                <ProductHome/>
      </div>
      <footer style={{ backgroundColor: "#89dcc2"}}>
                <div className='row'>
                    <div className='column'>
                        <h4>INFORMACION DE CONTACTO</h4>
                        <p>Arieta 2805, San Justo, Buenos Aires</p>
                        <p>(+54 9) 11 6942-1482</p>
                        <p>info@iluminarte.com.ar</p>
                        <a href='https://www.facebook.com/jardin.elisen/?locale=es_LA'>Facebook</a>
                        <a href='https://www.instagram.com/jardin.elisen/'>Instagram</a>
                    </div>
                    <div className='column'>
                        <h4>PESTAÑAS</h4>
                        <div to="/Contact">
                            <div>Contacto</div>
                        </div>
                        <div to="/Products">
                            <div>Productos</div>
                        </div>
                    </div>
                </div>
      </footer>
    </div>
    );
}

export default Home;
